def write_file(base64,source_file)
  content = base64
  content.gsub!('\\r', "\r")
  content.gsub!('\\n', "\n")
  decode_base64_content = Base64.decode64(content) 
  File.open(source_file, "wb") do |f|
    f.write(decode_base64_content)
  end
end

def extract_zip(file, destination)
  FileUtils.mkdir_p(destination)
  Zip::File.open(file) do |zip_file|
    zip_file.each do |f|
      fpath = File.join(destination, f.name)
      zip_file.extract(f, fpath) unless File.exist?(fpath)
    end
  end
end



def zip_file(dir,template_filename)

  FileUtils.rm template_filename,:force => true
  Zip::File.open(template_filename, 'w') do |zipfile|
    Dir.glob(dir+'**/**', File::FNM_DOTMATCH).each {|f| f==template_filename}.each do |file|
      zipfile.add(file.gsub(dir,''),file)
    end
  end
 File.chmod(0644,template_filename)
end




def replace(file_name,old_string,new_string)
    text = File.read(file_name)
    new_contents = text.gsub(old_string, new_string)
    File.open(file_name, "w") {|file| file.puts new_contents }

end

